    data: |
      SELECT DISTINCT + col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - col2 * + col2 BETWEEN + - col0 - + col1 AND - col1;
  - name: tab1

outputs:
  - name: q1983.out
    data: |
      51
      85
      91
